import React from "react";
import Nav from 'react-bootstrap/Nav';
import { Link } from "@reach/router";

const Navbar = (props) => {

    return (
        <div>
            <Nav defaultActiveKey="/home" as="ul">
                <Nav.Item as="li">
                    <Nav.Link href="/home">Active</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link eventKey="/starwars">Link</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link eventKey="link-2">  <Link to="starwars" />  </Nav.Link>
                </Nav.Item>
            </Nav>
        </div>
    );
}

export default Navbar;
